(()=>{"use strict";(t=>{console.log(t);const e=document.getElementById("timer-hours"),n=document.getElementById("timer-minutes"),o=document.getElementById("timer-seconds");let r;r=setInterval((()=>{let m=(()=>{let e=(new Date(t).getTime()-(new Date).getTime())/1e3;return{timeRemaining:e,hours:Math.floor(e/60/60%24),minutes:Math.floor(e/60%60),seconds:Math.floor(e%60)}})();const s=t=>1===String(t).length?"0"+t:String(t);e.textContent=s(m.hours),n.textContent=s(m.minutes),o.textContent=s(m.seconds),m.timeRemaining<=0&&(clearInterval(r),e.textContent=s(0),n.textContent=s(0),o.textContent=s(0))}),1e3)})("25 february 2023")})();